import React, { useState } from 'react'
import Image from 'next/image'
import Link from 'next/link'
import { useRouter } from 'next/router'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';


function Singleevent({ singleEvent }) {
    const [email, setemail] = useState('')
    const [error, seterror] = useState(false)
    const router = useRouter()
    async function handleSubmit(e) {
        e.preventDefault()
        const id = router.query.id;
        async function postData(data) {
            try {
                const response = await fetch('/api/register', {
                    method: 'POST',
                    headers: {
                        "Content-Type": "application/json",
                    },
                    body: JSON.stringify(data),
                })
                let resp = await response.json()
                let status = response.ok
                return {
                    resp,
                    status
                }
            } catch (error) {
                return error
            }
        }
        const response = await postData({
            id: id,
            email: email
        })
        if (!response.status) {
            seterror(true)
            toast.error(`${response.resp.msg}`, {
                position: "top-right",
                autoClose: 5000,
                hideProgressBar: false,
                closeOnClick: true,
                pauseOnHover: true,
                draggable: true,
                progress: undefined,
                theme: "light",
            });
        }
        else {
            toast.success(`${response.resp.msg}`, {
                position: "top-right",
                autoClose: 5000,
                hideProgressBar: false,
                closeOnClick: true,
                pauseOnHover: true,
                draggable: true,
                progress: undefined,
                theme: "light",
            });
            setemail('')
        }


    }
    return (
        <>
            <ToastContainer />
            <div className='singleEvent'>
                <Image width={500} height={500} src={singleEvent.image} alt="Picture of the author"
                    placeholder="blur"
                    blurDataURL="data:image/jpg;base64,"

                />
                <h4>{singleEvent.id}</h4>
                <p>{singleEvent.description}</p>

                <form onSubmit={handleSubmit}>
                    <input
                        placeholder='Enter your Email'
                        className={error ? 'error' : ''} type={'text'} value={email} onChange={(e) => {
                            setemail(e.target.value);
                            if (error) {
                                seterror(false)
                            }
                        }}
                    />
                    <button type='submit'>Submit</button>
                </form>
            </div>
        </>
    )
}

export default Singleevent